import React from "react";
import "./App.css";
import VideoList from "./components/VideoList";
import AddVideo from "./components/AddVideo";

function App() {
  return (
    <div className="App">
      <h1>Video Management App</h1>
      <VideoList />
      <AddVideo />
    </div>
  );
}

export default App;
